INSERT INTO `v1_124e725c50328d4d2d73ac36e5a5cf9d142149639463e3e2584c9ddadc0694e7` VALUES (2, 5000, "クスクス、悪くない\n流れですわね", 2, 2, 2, 3000, "vo_minigame_1013_icon_1_003_001", "vo_minigame_1013_icon_2_003_001", "ほらほら、\nまだいけるだろ？");
